-- Table structure for order
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `packer_id` int(11) DEFAULT NULL,
  `status` int(5) NOT NULL DEFAULT '2000' COMMENT '1000.失败（订单取消或无人接取等）\r\n\r\n2000.等待接单\r\n\r\n3000.已接单,派送中\r\n\r\n4000.接单方已确认订单\r\n4001.发单方已确认订单\r\n\r\n5000.接单方24小时后未确认订单，订单自动完成\r\n5001.发单方24小时后未确认订单，订单自动失效\r\n\r\n6000.最终状态不做判断，双方都确认订单',
  `cost` float(10,3) NOT NULL,
  `start_point` varchar(255) CHARACTER SET utf8mb4 NOT NULL,
  `end_point_id` int(11) NOT NULL,
  `item_type` varchar(255) CHARACTER SET utf8mb4 NOT NULL,
  `detail` varchar(255) CHARACTER SET utf8mb4 NOT NULL,
  `order_num` varchar(20) CHARACTER SET utf8mb4 NOT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `delete_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=latin1;

