-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(100) CHARACTER SET utf8mb4 NOT NULL,
  `score` int(11) DEFAULT '150' COMMENT '默认分数为150\r\n1.发送并完成一个订单加5分\r\n2.接取并完成一个订单加5分\r\n3.取消订单减2分\r\n\r\n逻辑关系：\r\n只要取消订单，不管那一方，都减3分\r\n\r\n确认订单，只要发单方确认，双方都加5分。\r\n\r\n接单方在发单方确认后确认再加1分\r\n接单方先确认不加分',
  `send_num` int(11) DEFAULT '0',
  `pack_num` int(11) DEFAULT '0',
  `scope` int(4) DEFAULT '16' COMMENT '0-无任何权限\r\n16-普通发单权限\r\n36-接单权限',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `delete_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

